import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="400"
      height="300"
      viewBox="0 0 400 300"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(28px)' }}
    >
      <ellipse cx="120" cy="200" rx="120" ry="80" fill="#00fff7" fillOpacity="0.22" />
      <ellipse cx="300" cy="100" rx="80" ry="60" fill="#ff00ea" fillOpacity="0.15" />
      <ellipse cx="200" cy="150" rx="100" ry="70" fill="#fff" fillOpacity="0.09" />
    </svg>
  );
}
